export const GET_OPTIONS = "GET_OPTIONS";

export const GET_OPTIONS_SUCCESS = "GET_OPTIONS_SUCCESS";

export const getOptions= () => ({
  "type": GET_OPTIONS
});

export const getOptionsSuccess = ({options}) => ({
    "type": GET_OPTIONS_SUCCESS,
    options
});
